import { Schema, model } from "mongoose";
const bcrypt = require("bcryptjs");

const registerEgresadosSchema = new Schema(
  {
    Nombre: {
      type: String,
      trim: true,
      require: true,
    },
    A_Paterno: {
      type: String,
      trim: true,
      require: true,
    },
    A_Materno: {
      type: String,
      trim: true,
      require: true,
    },
    Correo: {
      type: String,
      trim: true,
      require: true,
      unique: true,
    },
    Telefono: {
      type: String,
      require: true,
      trim: true,
    },
    Ciudad: {
      type: String,
      trim: true,
      require: true,
    },
    Carrera: {
      type: String,
      trim: true,
      require: true,
    },
    Especialidad: {
      type: String,
      trim: true,
      require: true,
    },
    Empresa: {
      type: String,
      require: true,
      trim: true,
      require: true,
    },
    Puesto: {
      type: String,
      require: true,
      trim: true,
    },
    CV: {
      type: String,
      trim: true,
    },
    Usuario: {
      type: String,
      trim: true,
      require: true,
      unique: true,
    },
    Contrasea: {
      type: String,
      trim: true,
      require: true,
    },
  },
  {
    //permite agregar created at y updated at
    timestamps: true,
    versionKey: false,
  }
);

//bcrypt password
registerEgresadosSchema.methods.encryptPassword = async (Contrasea) => {
  const salt = await bcrypt.genSalt(10);
  const hash = bcrypt.hash(Contrasea, salt);
  return hash;
};


//registerEgresadosSchema.methods.matchPassword= async function(Contrasea){
  //  return await bcrypt.compare(Contrasea,this.Contrasea)
//}
export default model("Egresados", registerEgresadosSchema);

